export function helloSomeone(x) {
  if (typeof x === "string") console.log("My name is x");
  if (typeof x === "null") console.log("I am null and void");
  if (typeof x === "number") {
    if (x <= 0) console.log("I am Benjamin Button!");
    else console.log("My age is x");
  }
  if (typeof x === "NaN") console.log("Age is just a number");
  if (typeof x === "undefined") console.log("Nobody can define me!");
}
